INSERT INTO `items` VALUES (1,'Zense, Deshi ni Korosareta Majo desu ga, Norowareta Deshi ni Ai ni Ikimasu','弟子に殺され、何故か記憶を保持したまま200年後に転生した祝福の魔女・アリシア。200年後の世界では、英雄となった弟子のヴィンセントが、祝福の魔女を殺した呪いで不老不死になっていて……えっ！？死の間際までヴィンセントの幸せを願ってはいたけれど、呪いなんてかけてません！可愛い弟子の呪いを解くため、直接会いに行ってきます！「小説家になろう」発！大人気、魔女と弟子のじれキュンラブストーリー','https://raw.senmanga.com/covers/zense-deshi-ni-korosareta-majo-desu-ga-norowareta-deshi-ni-ai-ni-ikimasu.jpg',0,0,0,0,'2023-11-06 10:54:08','2023-11-06 10:54:08',NULL),(2,'Dragon ni Sando Hikareta Ore no Tensei Shokunin Life','40歳を過ぎてもうだつの上がらない冒険者生活。そんな時、俺はドラゴンに轢かれて死んだ。お詫びに転生させてもらった人生でも、また轢かれて死んだ。３度目の人生もやっぱり轢かれ（ry　そんな俺は４度目の転生人生を冒険者じゃなく職人として生きることにした。何せ、ドラゴンが轢いたお詫びにくれた慰謝料がチートレベルで備わってるし、何か美人な巨乳のお姉さんたちが世話を焼いてくれるし……何か、順風満帆だし。','https://raw.senmanga.com/covers/dragon-ni-sando-hikareta-ore-no-tensei-shokunin-life.jpg',0,0,0,0,'2023-11-06 15:42:23','2023-11-06 15:42:23',NULL);
